CREATE TABLE market_data (
  data_id INT PRIMARY KEY,
  symbol VARCHAR(255),
  price DECIMAL(10, 2),
  volume INT
);

CREATE TABLE trading_decisions (
  decision_id INT PRIMARY KEY,
  data_id INT FOREIGN KEY REFERENCES market_data(data_id),
  buy_sell VARCHAR(10),
  timestamp TIMESTAMP
);

